PIDKey Lite 1.62.9 !{Latest}

The&#xA0;PIDKey Lite&#xA0;program is&#xA0;designed to view, update and save information about keys for M $ products in the database.

It allows you to replace PIDKey by Ratiborus, Ultimate PID Checker by janek2012 and VAMT.&#xA0;The PIDKey Lite program is the successor of PIDKey and took the best ideas from it.

The main feature of the program is the creation of a SQL database in contrast to PIDKey, where the database was actually stored in text files.

The program allows you to add new keys in two modes (the modes for adding keys will be described below) and to check them, find the keys in the database, update information about them and (or) move them to blocked ones.

You must have an Internet connection to determine the number of MAK key activations available.&#xA0;The program does not require installation and is completely portable.&#xA0;The key database already contains GVLK keys, undefined and locked keys from sources that are trustworthy.

Changes in the version:
- Updated the key database

